import { Hotel, PrismaClient } from "@prisma/client";
import dayjs from "dayjs";
const prisma = new PrismaClient();

async function main() {
  let event = await prisma.event.findFirst();
  if (!event) {
    event = await prisma.event.create({
      data: {
        title: "Driven.t",
        logoImageUrl: "https://files.driven.com.br/images/logo-rounded.png",
        backgroundImageUrl: "linear-gradient(to right, #FA4098, #FFD77F)",
        startsAt: dayjs().toDate(),
        endsAt: dayjs().add(21, "days").toDate(),
      },
    });
  }
  /////////////////////////////////////////////////////////
  let hotelA = await prisma.hotel.findFirst();
  let hotelB = await prisma.hotel.findFirst();
  if (!hotelA) {
    hotelA = await prisma.hotel.create({
      data: {
        name: "HOTEL-A",
        image: "data:image/jpeg;base64,",
        createdAt: dayjs().toDate(),
        updatedAt: dayjs().toDate()
      },
    });
    hotelB = await prisma.hotel.create({
      data: {
        name: "HOTEL-B",
        image: "data:image/jpeg;base64,",
        createdAt: dayjs().toDate(),
        updatedAt: dayjs().toDate()
      },
    });
  }
  /////////////////////////////////////////////////////////
  let roomA = await prisma.room.findFirst();
  let roomB = await prisma.room.findFirst();
  if (!roomA) {
    roomA = await prisma.room.create({
      data: {
        name: "room-A",
        capacity: 10,
        hotelId: 1,
        createdAt: dayjs().toDate(),
        updatedAt: dayjs().toDate()
      },
    });
    roomB = await prisma.room.create({
      data: {
        name: "room-B",        
        capacity: 15,
        hotelId: 2,
        createdAt: dayjs().toDate(),
        updatedAt: dayjs().toDate()
      },
    });
  }
  

  console.log(roomA, roomB);
}

main()
  .catch((e) => {
    console.error(e);
    process.exit(1);
  })
  .finally(async () => {
    await prisma.$disconnect();
  });
